is a function to convert `struct` directly to `sql.Table` and we don't need to modify the `sql.Schema` each time when table ois updated. If this feature is needed, I am happy to contribute some pull requests 😃.", 'reactions': {'url': 'https://api.github.com/repos/dolthub/go-mysql-server/issues/908/reactions', 'total_count': 0, '+1': 0, '-1': 0, 'laugh': 0, 'hooray': 0, 'confused': 0, 'heart': 0, 'rocket': 0, 'eyes': 0}, 'timeline_url': 'https://api.github.com/repos/dolthub/go-mysql-server/issues/908/timeline', 'performed_via_github_app': None}, 'comment': {'url': 'https://api.github.com/repos/dolthub/go-mysql-server/issues/comments/1079146526', 'html_url': 'https://github.com/dolthub/go-mysql-server/issues/908#issuecomment-1079146526', 'issue_url': 'https://api.github.com/repos/dolthub/go-mysql-server/issues/908', 'id': 1079146526, 'node_id': 'IC_kwDOC4zqFc5AUnge', 'user': {'login': 'fulghum', 'id': 193449, 'node_id': 'MDQ6VXNlcjE5MzQ0OQ==', 'avatar_url': 'https://avatars.githubusercontent.com/u/193449?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/fulghum', 'html_url': 'https://github.com/fulghum', 'followers_url': 'https://api.github.com/users/fulghum/followers', 'following_url': 'https://api.github.com/users/fulghum/following{/other_user}', 'gists_url': 'https://api.github.com/users/fulghum/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/fulghum/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/fulghum/subscriptions', 'organizations_url': 'https://api.github.com/users/fulghum/orgs', 'repos_url': 'https://api.github.com/users/fulghum/repos', 'events_url': 'https://api.github.com/users/fulghum/events{/privacy}', 'received_events_url': 'https://api.github.com/users/fulghum/received_events', 'type': 'User', 'site_admin': False}, 'created_at': '2022-03-25T15:34:19Z', 'updated_at': '2022-03-25T15:34:19Z', 'author_association': 'CONTRIBUTOR', 'body': "Ahhh, I think I see what you mean now. Thank you for the extra details. So instead of marshalling SQL statements over the server interface to a go-mysql-server in a separate process in order to create the tables that are modeled by structs, you'd like to do this all inside a single Go process to create the tables directly using the gorm syntax? 

Out of curiosity, is there a specific use case you're thinking about? Something like embedding go-mysql-sever for structured data storage inside an application? What would the interface for storing/retrieving data look like? 

My gut feeling is that it would be best to build this as a separate layer on top of go-mysql-server, to explore the idea further, see how it works, and see if it becomes a feature enough go-mysql-server customers would want to warrant pulling it into the core of go-mysql-server. If you do end up building something, we would love to stay in touch, see how it works, and of course we'd be happy to answer any go-mysql-server questions, too. ", 'reactions': {'url': 'https://api.github.com/repos/dolthub/go-mysql-server/issues/comments/1079146526/reactions', 'total_count': 0, '+1': 0, '-1': 0, 'laugh': 0, 'hooray': 0, 'confused': 0, 'heart': 0, 'rocket': 0, 'eyes': 0}, 'performed_via_github_app': None}}

