uate column names with tag suffixes. 

The new `dolt_diff` system table function enables callers to use the exact to and from schemas in a two-way diff of table data. Using [this sample data input](https://gist.github.com/fulghum/1a12f94e21ba63f4ac605727f13ae648), the following examples show what the `dolt_diff` table function returns in different cases.

General example:
```
